import './App.css';
import React from "react";


function App() {

    return (
        <div>
            <h2>Đăng nhập</h2>
            <form>
                <label>
                    Username:
                    <input type="text" value={username} onChange={handleUsernameChange} />
                </label>
                <br />
                <label>
                    Password:
                    <input type="password" value={password} onChange={handlePasswordChange} />
                </label>
                <br />
                <button type="button" onClick={handleLogin}>
                    Đăng nhập
                </button>
            </form>
        </div>
    );
}

export default App;
